alphabet = "A  C  D  E  F  G  H  I  K  L  M  N  P  Q  R  S  T  V  W  Y".split("  ")
blosum = [[int(item) for item in line.split()] for line in blosum.strip().split("\n")]
tmp = {item: {} for item in alphabet}
for i, line in enumerate(blosum):
    key1 = alphabet[i]
    for j, value in enumerate(line):
        key2 = alphabet[j]
        tmp[key1][key2] = value
blosum = tmp
penalty = -5

def alignment(a, b):
    n, m = len(a), len(b)
    result = [[0 for j in range(n+1)] for i in range(m+1)]
    for i in range(0, m+1):
        result[i][0] = penalty * i
    for j in range(0, n+1):
        result[0][j] = penalty * j
    # for item in result:
    #     print(item)
    for i in range(1, m+1):
        for j in range(1, n+1):
            match = result[i-1][j-1] + blosum[b[i-1]][a[j-1]]
            tmp1 = result[i][j-1] + penalty
            tmp2 = result[i-1][j] + penalty
            result[i][j] = max(match, tmp1, tmp2)

    i, j = m, n
    b_res, a_res = "", ""
    while i > 0 and j > 0:
        if result[i][j] - blosum[b[i-1]][a[j-1]] == result[i-1][j-1]:
            b_res += b[i-1]
            a_res += a[j-1]
            i, j = i-1, j-1
        elif result[i][j] - penalty == result[i][j-1]:
            b_res += "-"
            a_res += a[j-1]
            j -= 1
        else:
            b_res += b[i-1]
            a_res += "-"
            i -= 1
    if i > 0:
        while i > 0:
            a_res += "-"
            b_res += b[i-1]
            i -= 1
    elif j > 0:
        while j > 0:
            a_res += a[j-1]
            b_res += "-"
            j -= 1
    return result[-1][-1], a_res[::-1], b_res[::-1]

